import React from "react";
import "./style.css";

const CharacterCard = ({Friends}) => {
  return (
    <div className="card">
      <div className="img-container">
        <img
          alt={Friends.name}
          src={Friends.image}
        />
      </div>
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {Friends.name}
          </li>
          <li>
            <strong>Occupation:</strong> {Friends.occupation}
          </li>
          <li>
            <strong>Location:</strong> {Friends.location}
          </li>
        </ul>
      </div>
    </div>
  );
}

export default CharacterCard;
